	private static Map<String,Result> getData(JSONObject cnt,double percent,Map<String,Result> data) {
		if(data==null)
			data = new HashMap<>();
		double totalPercent = Double.parseDouble(isNullOrEmpty(cnt.getString("Percent"))?"1":cnt.getString("Percent").replace("%", ""))*percent/100;		
		if(cnt.getIntValue("Org")==2) {
			if(data.containsKey(cnt.getString("Name")))  {
				Result tmpResult = data.get(cnt.getString("Name"));
				tmpResult.setPercent(tmpResult.getPercent()+totalPercent).setShouldCapi(tmpResult.getShouldCapi()+cnt.getDoubleValue("ShouldCapi"));
				data.put(cnt.getString("Name"), tmpResult);
			}
			else
				data.put(cnt.getString("Name"), new Result(cnt.getString("Name"), totalPercent,cnt.getDoubleValue("ShouldCapi")));
		}
		for(Object child:cnt.getJSONArray("DetailList")) {
			getData((JSONObject) child,isNullOrEmpty(cnt.getString("PercentTotal"))?totalPercent:Double.parseDouble(cnt.getString("PercentTotal").replace("%", ""))/100,data);
		}
		return data;
	}

	private static void trace(JSONObject cnt,double percent,String spilter) {
		double totalPercent = Double.parseDouble(isNullOrEmpty(cnt.getString("Percent"))?"1":cnt.getString("Percent").replace("%", ""))*percent/100;		
		System.out.printf("%s%s(%s)(%s)**(%s)\r\n",spilter, cnt.getString("Name")
				,isNullOrEmpty(cnt.getString("Percent"))?"":cnt.getString("Percent")
				,isNullOrEmpty(cnt.getString("PercentTotal"))?"":cnt.getString("PercentTotal")
				,totalPercent*100);
		JSONArray cntChildren = cnt.getJSONArray("DetailList");
		final String lvl = spilter.concat(spilter);
		cntChildren.forEach(child->trace((JSONObject) child,isNullOrEmpty(cnt.getString("PercentTotal"))?totalPercent:Double.parseDouble(cnt.getString("PercentTotal").replace("%", ""))/100,lvl));
	}
	
	private static boolean isNullOrEmpty(String instr) {
		return instr==null||"".equals(instr);
	}
	
